import React from "react";
import weather_icons_cloudy from "../../assets/SVG/weather_icons_cloudy.svg";

const ActualPos = () => {
  const location = "San Marcos";
  const date = "5PM 07/07/22";

  return (
    <div className="bg-cyan-200 rounded-lg w-1/2 m-auto h-4/5">
      <p> {location}</p>
      <p> {date} </p>
      <img
        src="../../assets/SVG/weather_icons_cloudy.svg"
        alt="SVG as an image"
      ></img>
    </div>
  );
};

export default ActualPos;
